import React from 'react';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';
import { Bar } from 'react-chartjs-2';


ChartJS.register(
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend
);

export const options = {
  indexAxis: 'y',
  elements: {
  },
  responsive: true,
  plugins: {
    legend: {
      position: 'right',
    },
    title: {
      display: true,
      text: 'Chart.js Horizontal Bar Chart',
    },
  },
};

const labels = ['Tanner Hodge','Lynda shames','Luke Burke','Kai Gaines','Kenzie Fields','Sophie Mortimer','Leanne coy','Kayia Park','Sarah Mathews','James Murdock'];

export const data = {
  labels,
  datasets: [
    {
      label: 'Dataset 1',
      data:[117,65,59,56,54,51,40,32,29,23],
      borderColor: 'rgb(255, 99, 132)',
      backgroundColor: 'rgb(125, 187, 5)',
    },
  ],
};

 function C2() {
  return(<>
   <div className="container2" >
  <Bar options={options} data={data} width={20}/>;
  </div>
  </>)
}
export default C2;
